Storyline

True-crime writer Ellison Oswalt moves himself and his family in to a house where an horrific crime took place earlier, but his family doesn't know. He is trying to find out more about the crime so he can write a new book about it to help his flailing career. He uses some &quot;snuff&quot; film that he finds which show the crimes to help in his research, but he soon finds more than he bargained for. There is a figure in each of the films, but who or what is it? As a result his family start to suffer as does he. Things take a turn for the worst. Will they survive? 


